<html>
    <head>
        <meta charset="utf-8">
        <meta name="viewport" content="width=device-width, initial-scale=1.0,
        maximum-scale=1.0, user-scalable=no">
        <title>t.rex extracted</title>
        <style>
            #offline-resources{
                display: none;
            }
        </style>
    </head>
    <body style="background-color: slategrey; padding:0; margin:0; width: 1200px; height: 600px;" >
        <div id="main-frame-error" class="interstitial-wrapper" jstcache="0">
        <img class="icon icon-offline" jseval="updateIconClass(this.classList, iconClass)" jstcache="1" style="visibility: hidden;">
            <div class="runner-container" style="width: 1200px; height: 600px;">
                <canvas class="runner-canvas" width="1200" height="600"></canvas>
            </div>
        </div>

        <div id="offline-resources" jstcache="0">
            <img id="rabbit" src="img/rabbit.png" jstcache="0">
            <img id="brick" src="img/brick.png" jstcache="0">
            <img id="tunnelEntrance" src="img/tunnelEntrance.png" jstcache="0">
            <img id="jail" src="img/jail.png" jstcache="0">
        </div>
        <script src="scripts/rabit.js?n=1"></script>
    </body>
</html>
